__NUXT_JSONP__("/svet/stat/niue/co-videt", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r){return {data:[{place:[{tld:".nu",name:"Niue",area:260,population:1624,slug:j,id_continent:e,information_chatgpt:"\u003Cp\u003ENiue je malý ostrovní stát v jižním Pacifiku. Nachází se asi 2400 km severovýchodně od Nového Zélandu a má rozlohu pouze 260 km². Niue je známé pro své křišťálově čisté vody a úchvatné korálové útesy, což přiláká mnoho turistů.\u003C\u002Fp\u003E\n\u003Cp\u003EPro turisty jsou k dispozici mnohé aktivity, jako jsou potápění, šnorchlování, surfování a rybaření. Niue je také populární pro pozorování velryb, zejména od června do října, kdy sem migrují velryby k těmto vodám.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě toho má Niue také několik zajímavých turistických atrakcí. Například návštěva krasových jeskyní s podzemními řekami, vodopádů a mnoho dalšího. Niue je také známé pro svou unikátní kulturu a tradice, které se odrážejí v jeho umění, řemeslech a gastronomii.\u003C\u002Fp\u003E\n\u003Cp\u003EVzhledem k malému počtu turistů, kteří do Niue přijíždějí, zůstává Niue relativně nedotčen masovou turistikou a zachovává si své autentické prostředí. Turisté mohou objevovat niuejskou kulturu, zvyky a lidovou architekturu, stejně jako ochutnat místní speciality v niuejských restauracích a kavárnách.\u003C\u002Fp\u003E\n\u003Cp\u003EPřestože Niue není tak často navštěvováno jako jiné ostrovní destinace, může být velmi zajímavou zkušeností pro turisty, kteří hledají autentickou a neturistickou cestu. Niue nabízí jedinečnou kombinaci přírodní krásy, kultury a odpočinku na bílých plážích v tichém a klidném prostředí.\u003C\u002Fp\u003E",currency_code:"NZD",currency_name:"novozélandský dolar",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:a,date_update:b},{name:"Chleba",value:a,date_update:b},{name:"Mléko",value:a,date_update:b},{name:"Voda (500ml)",value:a,date_update:b},{name:"Espresso",value:a,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Bic Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:a,date_update:b}],phone_numbers_emergency:[{name:"Turistická policie",value:"0800886",date_update:b},{name:"Pobřežní záchranná služba",value:"0800456",date_update:b}],phone_prefix:"+683",coordinates:[{latitude:"-19.054445",longitude:"-169.867233"}],people_religion:[{name:"Křesťanství",value:"97%",date_update:k},{name:"Bez vyznání",value:"3%",date_update:k}],people_nationality:[{name:"Niueané",value:"66,5%",date_update:f},{name:"Samoané",value:"11,7%",date_update:f},{name:"Tongané",value:"2,4%",date_update:f},{name:"Ostatní",value:"19,4%",date_update:f}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz není platným cestovním dokladem pro vstup do Niue. Je nutné mít platný cestovní pas.",date_update:b},{name:"Cestovní pas",value:"Pro vstup do Niue je nutné mít platný cestovní pas. Občanský průkaz není platným cestovním dokladem.",date_update:b},{name:"Vízum",value:"Pro občany České republiky není nutné mít předem vyřízené vízum pro vstup do Niue, pokud pobyt nepřesáhne 30 dní. Při pobytu delším než 30 dní je nutné požádat o prodloužení pobytu u místní imigrační služby. Pokud cestujete z jiné země než z České republiky, může být vízum nutné. Doporučujeme se informovat na velvyslanectví Niue v příslušné zemi.",date_update:b},{name:"Očkování",value:"Pro vstup do Niue není nutné mít žádné specifické očkování. Doporučuje se mít aktualizovanou očkovací kartu podle zdravotního stavu a plánovaného pobytu.",date_update:b},{name:"Cestovní pojištění",value:"Pro vstup do Niue není vyžadováno cestovní ani zdravotní pojištění. Nicméně, vzhledem k tomu, že zdravotní péče na ostrově není kompletní a může být velmi drahá, doporučuje se, aby cestovatelé měli dostatečné zdravotní pojištění s pokrytím nákladů na případnou lékařskou péči během pobytu.",date_update:b},{name:"Bezpečnostní situace",value:"Niue je považováno za bezpečnou zemi s nízkou mírou kriminality. Nicméně, cestovatelé by měli být obezřetní a pečlivě sledovat své cennosti, zejména na veřejných místech a plážích.",date_update:b},{name:"Další informace",value:"Niue je malý ostrovní stát s několika turistickými atrakcemi, jako jsou korálové útesy, jeskyně a možnosti potápění. Na ostrově není mnoho turistických zařízení, nicméně jsou k dispozici některé hotely a penziony. Cestovatelé by si měli být vědomi toho, že na ostrově se používá novozélandský dolar a že v některých místech může být omezený přístup k internetu a mobilnímu signálu.",date_update:b}],type_place:l,id_image_cover:g,id_image_hero:g,id_city_main:h,affiliate:[{name:m,value:n}],mpz:"NU",alerts:a,zoom:[{google:i,booking:i}],ids_neighboring_countries:[],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:o,facts:a}],imagePlace:[{id:g,name:j,source:"\u002Fworld\u002Fstates\u002F",date_create:"2023-05-06T09:27:42.033044+00:00",type:l,author:"Msdstefan"}],placesStatesNeighboring:a,imagesStatesNeighboring:a,placeContinent:[{id:e,slug:"australie-a-oceanie",name:"Austrálie a Oceánie",area:8560000,population:42000000,population_density:4.9,number_states:14,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E je kontinent, které se nachází na jižní polokouli. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E je největší zemí v Oceánii, zatímco Oceánie zahrnuje mnoho ostrovů v Tichomoří, včetně \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nové Guiney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsamoa\"\u003ESamoa\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETongy\u003C\u002Fa\u003E\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie\u003C\u002Fb\u003E je známá svými exotickými zvířaty, jako jsou \u003Cb\u003Eklokani\u003C\u002Fb\u003E, \u003Cb\u003Ekoaly\u003C\u002Fb\u003E a \u003Cb\u003Eemuové\u003C\u002Fb\u003E. Je také domovem mnoha překrásných pláží, kde se lze slunit, surfovat a potápět. Nejznámějšími městy jsou \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E je známé svým \u003Cb\u003Eoperním domem\u003C\u002Fb\u003E a \u003Cb\u003EHarbour Bridge\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E je považováno za kulturní centrum a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E je ideální pro milovníky adrenalinových sportů, jako je rafting a skákání padákem.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENový Zéland\u003C\u002Fa\u003E\u003C\u002Fb\u003E, má jedinečnou přírodu a kulturu. Nachází se zde mnoho přírodních památek, včetně hor, jezer a národních parků. Země je také domovem mnoha původních \u003Cb\u003EMaorů\u003C\u002Fb\u003E a jejich kultury. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fauckland\"\u003EAuckland\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fwellington\"\u003EWellington\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší města na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, zatímco \u003Cb\u003EQueenstown\u003C\u002Fb\u003E je oblíbená destinace pro turisty hledající adrenalinové sporty a krásnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E je jednou z nejvíce odlehlých a exotických destinací na světě. Země je plná původních kmenů a mnoha z nich si stále zachovávají tradiční zvyky a rituály. Turisté sem jezdí kvůli krásným plážím a překrásné přírodě. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fport-moresby\"\u003EPort Moresby\u003C\u002Fa\u003E\u003C\u002Fb\u003E je hlavním městem země a láká návštěvníky svými muzei a historickými památkami.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E je také známá svými neuvěřitelnými korálovými útesy a podmořským životem. Korálové útesy \u003Cb\u003EVelký bariérový útes\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší na světě a lákají milovníky potápění z celého světa. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETonga\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou další oblíbené destinace pro potápěče a snorkelisty.\u003C\u002Fp\u003E\u003Cp\u003EMezi další známé ostrovy v \u003Cb\u003EOceánii\u003C\u002Fb\u003E patří \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E, které jsou součástí USA. \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E jsou známé svými surferskými plážemi, sopkami a krásnou přírodou. \u003Cb\u003ETahiti\u003C\u002Fb\u003E, největší ostrov \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, láká návštěvníky svými luxusními resorty, bílými plážemi a modrými lagunami. \u003Cb\u003EBora Bora\u003C\u002Fb\u003E, jeden z ostrovů \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je oblíbený mezi páry hledající romantickou dovolenou.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E má také bohatou historii a kulturu původních obyvatel. Původní obyvatelé \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003EMaorové\u003C\u002Fb\u003E, mají svou vlastní kulturu a jazyk. V \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou původní obyvatelé \u003Cb\u003EAboridžinci\u003C\u002Fb\u003E, kteří mají svůj vlastní jazyk, tradice a umění. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho různých původních kmenů, z nichž každý má své vlastní tradice a jazyk.\u003C\u002Fp\u003E\n\u003Cp\u003ECo se týče cestování do \u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E, musí cestovatelé získat víza pro vstup do země, pokud je to požadováno. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho mezinárodních letišť, zatímco v \u003Cb\u003EOceánii\u003C\u002Fb\u003E jsou letiště menší a mohou být omezenější. Mnoho ostrovů v \u003Cb\u003ETichomoří\u003C\u002Fb\u003E má také přísné pravidla pro dovoz zahraničních rostlin a zvířat, aby se chránila původní ekologie.\u003C\u002Fp\u003E\n\u003Cp\u003EV \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E a na mnoha ostrovech v \u003Cb\u003EOceánii\u003C\u002Fb\u003E se můžete potkat s tropickým klimatem s teplými lety a mírnými zimami. V některých částech \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E však může být klima velmi suché a horké, zatímco na jiných místech může být velmi vlhké a deštivé.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E jsou také oblíbenými destinacemi pro adrenalinové sporty, jako je potápění, surfování, skákání padákem, rafting a další. Mnoho turistů také navštěvuje \u003Cb\u003EAustrálii a Oceánii\u003C\u002Fb\u003E kvůli sportovním akcím, jako jsou tenisové turnaje v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nebo ragbyové zápasy na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003Cb\u003E.\u003C\u002Fp\u003E",coordinates:[{latitude:-25.274398,longitude:133.775136}],type_place:"continent",id_image_cover:e,id_image_hero:e,zoom:[{google:p,booking:p}],information_author:a,seo_tags:a}],placesCities:[{id:h,id_image_cover:a,importance:c,slug:q,type_place:d,name:r},{id:1669,id_image_cover:a,importance:c,slug:"avatele",type_place:d,name:"Avatele"},{id:1670,id_image_cover:a,importance:c,slug:"hakupu",type_place:d,name:"Hakupu"},{id:1675,id_image_cover:a,importance:c,slug:"lakepa",type_place:d,name:"Lakepa"},{id:1672,id_image_cover:a,importance:c,slug:"makefu",type_place:d,name:"Makefu"},{id:1671,id_image_cover:a,importance:c,slug:"mutalau",type_place:d,name:"Mutalau"},{id:1674,id_image_cover:a,importance:c,slug:"namukulu",type_place:d,name:"Namukulu"},{id:1676,id_image_cover:a,importance:c,slug:"tamakautoga",type_place:d,name:"Tamakautoga"},{id:1677,id_image_cover:a,importance:c,slug:"toi",type_place:d,name:"Toi"},{id:1673,id_image_cover:a,importance:c,slug:"tuapa",type_place:d,name:"Tuapa"}],imagesCities:a,placeCityMain:[{id:h,id_state:o,name:r,population:624,area:46.48,altitude:0,slug:q,information_chatgpt:a,coordinates:[{latitude:-19.0592,longitude:-169.9187}],biggest:"yes",type_place:d,id_image_cover:a,id_image_hero:a,affiliate:[{name:m,value:n}],alerts:a,zoom:[{google:10,booking:i}],parking:a,information_author:a,importance:c,seo_tags:a}],imageCityMain:a}],fetch:{"OrganismsoSidebarListComponent:0":{events:[],images:a}},mutations:[]}}(null,"05-2023","biggest","city",6,"2017",420,1668,11,"niue","03-2017","state","booking",true,170,3,"alofi","Alofi")));